import React, { useState } from 'react';

const Count = () => {
	// const [count, setCount] = useState(0);
	let count = 1;
	console.log(`Count when rendering is ${count}`);

	const incrementHandler = () => {
		count = count + 1;
	};

	return (
		<div>
			<p>Count is {count}</p>
			<button onClick={incrementHandler}>Increment</button>
		</div>
	);
};

export default Count;
